import React from "react"

const Footer = () => {
    return (
        <div className="bg-gray-700 p-4">
            <div className="container mx-auto text-center font-bold text-white">
                Projeto desenvolvido por: <a href="https://nelsonjrportfolio.imfast.io/">Nelson Jr</a> / <a href="https://www.linkedin.com/in/nelson-dellosbel-junior-ba80211ab/">Linkedin</a> / <a href="https://github.com/Juniordell">Github</a>
            </div>
        </div>
    )
}

export default Footer
